import styled from 'styled-components';

const FooterStyles = styled.li`
  #footer {
    display: grid;
    grid-gap: 0;
    padding: 0;
    margin: 0;
    grid-template-columns: 11vw 26vw 26vw 26vw 11vw;
    grid-template-rows: 5px 30vh 30px;
    background-color: rgb(114, 128, 138);
  }

  li {
    list-style-type: none;
    font-size: 24px;
    color: snow;
    text-decoration: none;
    padding: 0;
    margin: 0;
  }

  li:hover {
    text-decoration: underline;
  }

  #top {
    grid-row: 1;
    grid-column: 1 / 5;
    padding: 0;
    margin: 0;
    max-height: 5px;
    width: 100vw;
    background-color: rgb(40, 44, 46);
  }

  #left {
    grid-row: 2;
    grid-column: 2;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    width: 26vw;
    justify-self: center;
    background-color: rgb(40, 44, 46);
  }
  #center {
    grid-row: 2;
    grid-column: 3;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    justify-self: center;
  }

  #right {
    grid-row: 2;
    grid-column: 4;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    justify-self: center;
    background-color: rgb(40, 44, 46);
  }

  #bottom {
    grid-row: 3;
    grid-column: 1 / 5;
    padding: 0;
    margin: 0;
    max-height: 30px;
    width: 100vw;
    background-color: rgb(40, 44, 46);
  }
`;

export default FooterStyles;
